INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "A", 100101, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", "東山奈央", 44, 155, 16, "獣人族", "人助け、応援", 27, 0, 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "O", 100201, "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 47, 158, 17, "ヒューマン", "料理、人間観察", 5, 0, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "B", 100301, "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", "早見沙織", 46, 163, 18, "魔族", "読書、乗馬、お茶", 12, 0, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (5, "O", 100401, "リトルリリカル", "探検好きのイタズラっ子", "諸星すみれ", 27, 128, 9, "ヒューマン", "いたずら、探検", 10, 0, 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ミソギ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (8, "O", 100501, "王宮騎士団（NIGHTMARE）", "ヒーローに憧れる騎士見習いの少女", "下田麻美", 40, 146, 12, "獣人族", "ヒーローごっこ", 25, 0, 11, "？？？", "マツリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "O", 100601, "悪魔偽王国軍（ディアボロス）", "甘え上手なみんなの人気者", "浅倉杏美", 42, 150, 13, "魔族", "サックス", 22, 0, 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "アカリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "B", 100701, "悪魔偽王国軍（ディアボロス）", "プリン大好きゴースト娘", "雨宮天", 32, 130, 14, "魔族", "プリンを食べること", 23, 0, 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "AB", 100801, "ヴァイスフリューゲル　ランドソル支部", "ボクは誰よりも美しい", "大空直美", 40, 150, 14, "エルフ", "鏡で自分を見ること", 10, 0, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "A", 100901, "トワイライトキャラバン", "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", 45, 159, 17, "魔族", "小説執筆", 5, 0, 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "アンナ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "O", 101001, "自警団（カォン）", "マホマホ王国のプリンセス", "内田真礼", 42, 155, 16, "獣人族", "空想、ぬいぐるみ集め", 22, 0, 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (3, "A", 101101, "ラビリンス", "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", 44, 156, 15, "ヒューマン", "お裁縫", 25, 0, 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "リノ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (6, "A", 101201, "フォレスティエ", "みんなのために超能力を使う眠り姫", "大橋彩香", 46, 156, 17, "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 24, 0, 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "ハツネ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "O", 101301, "トワイライトキャラバン", "オタク全開な魔法少女", "佳村はるか", 55, 166, 18, "魔族", "読書、魔法", 21, 0, 8, "", "ナナカ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "AB", 101401, "自警団（カォン）", "頭脳明晰な美少女名探偵", "水瀬いのり", 41, 152, 15, "獣人族", "読書、推理", 3, 0, 11, "test", "カスミ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (6, "O", 101501, "フォレスティエ", "母性溢れる優しいみんなの「ミサト先生」", "國府田マリ子", 54, 165, 21, "エルフ", "絵本作り", 5, 0, 9, "test", "ミサト");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (14, "O", 101601, "ルーセント学院", "天真爛漫で人気者のカリスマモデル", "上坂すみれ", 48, 167, 18, "魔族", "ファッション", 10, 0, 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "スズナ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "A", 101701, "自警団（カォン）", "いつでも「なんくるないさ～」な天然娘", "高森奈津美", 53, 158, 19, "獣人族", "踊り、空手", 7, 0, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "カオリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (14, "B", 101801, "ルーセント学院", "多くの男性を魅了する無垢な女教師", "伊藤静", 52, 162, 23, "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 14, 0, 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "イオ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (5, "O", 102001, "リトルリリカル", "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", 21, 117, 10, "獣人族", "かわいいもの集め", 3, 0, 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "ミミ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "B", 102101, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 40, 150, 12, "ヒューマン", "観劇、おままごと", 9, 0, 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "O", 102201, "悪魔偽王国軍（ディアボロス）", "人見知りであまのじゃくな女の子", "原紗友里", 40, 150, 13, "魔族", "ゲーム全般", 22, 0, 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ヨリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "B", 102301, "サレンディア救護院", "ぷうきちといつも一緒！", "芹澤優", 38, 148, 14, "ヒューマン", "屋内でできる遊び", 10, 0, 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "O", 102501, "サレンディア救護院", "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", 43, 154, 15, "ヒューマン", "ご奉仕", 12, 0, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (11, "B", 102601, "牧場（エリザベスパーク）", "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", 42, 144, 17, "獣人族", "あんパン", 1, 0, 1, "test", "リン");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "B", 102701, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", "橋本ちなみ", 43, 154, 16, "魔族", "実験、裁縫、料理", 30, 0, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "A", 102801, "サレンディア救護院", "救護院を経営する優しい庶民派お嬢様", "堀江由衣", 43, 156, 17, "エルフ", "経営、お茶会", 4, 0, 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレン");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (4, "B", 102901, "カルミナ", "歌って踊れる大人気アイドル", "日笠陽子", 40, 157, 17, "ヒューマン", "舞台鑑賞、ダンス", 24, 0, 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ノゾミ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "O", 103001, "ヴァイスフリューゲル　ランドソル支部", "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 51, 163, 16, "ヒューマン", "忍法開発", 31, 0, 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "AB", 103101, "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", "大坪由佳", 42, 157, 18, "魔族", "占い", 22, 0, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "AB", 103201, "メルクリウス財団", "一人前の商人を目指すパワフルお嬢様", "松嵜麗", 45, 157, 18, "ヒューマン", "慈善事業", 12, 0, 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "アキノ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (11, "B", 103301, "牧場（エリザベスパーク）", "みんなを笑顔にするお笑い牧場主", "新田恵海", 35, 142, 20, "ヒューマン", "漫才", 3, 0, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "マヒル");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "A", 103401, "メルクリウス財団", "純情でほっとけない大人の女性", "今井麻美", 55, 164, 22, "エルフ", "ウインドーショッピング", 16, 0, 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ユカリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (5, "A", 103601, "リトルリリカル", "礼儀正しくしっかり者のちびっ子優等生", "小倉唯", 21, 118, 8, "エルフ", "お勉強", 2, 0, 2, "test", "キョウカ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (8, "A", 103701, "王宮騎士団（NIGHTMARE）", "義理堅くてからかい好きな剣術少女", "茅原実里", 43, 149, 13, "ヒューマン", "剣術、年長者をからかう", 11, 0, 8, "test", "トモ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (11, "A", 103801, "牧場（エリザベスパーク）", "読書が趣味の病弱少女", "小清水亜美", 40, 153, 14, "獣人族", "読書、お散歩", 3, 0, 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "シオリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (6, "AB", 104001, "フォレスティエ", "「友達」に憧れる、エルフの森の女の子", "花澤香菜", 44, 158, 13, "エルフ", "友達作りのイメトレ", 6, 0, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "アオイ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (4, "O", 104201, "カルミナ", "人々を守るために歌う、唱喚士の少女", "福原綾香", 46, 163, 17, "ヒューマン", "各種楽器", 3, 0, 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "O", 104301, "自警団（カォン）", "男勝りで情に厚いワイルド娘", "小松未可子", 54, 168, 17, "獣人族", "お菓子作り", 9, 0, 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "マコト");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "A", 104401, "悪魔偽王国軍（ディアボロス）", "かつては夜を支配した最強の吸血鬼", "丹下桜", 50, 172, "??", "魔族", "世界征服", 5, 0, 5, "test", "イリヤ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "AB", 104501, "ヴァイスフリューゲル　ランドソル支部", "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", 49, 157, 18, "ヒューマン", "小説を読むこと", 19, 0, 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "クウカ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "AB", 104601, "メルクリウス財団", "弱きを助け強きをくじく猫娘", "沼倉愛美", 48, 158, 18, "獣人族", "猫とたわむれること", 1, 0, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (8, "A", 104701, "王宮騎士団（NIGHTMARE）", "素顔を見せない冷静沈着な女性騎士", "川澄綾子", 50, 171, 25, "ヒューマン", "格闘技、湯浴み", 25, 0, 10, "？？？", "ジュン");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "O", 104801, "メルクリウス財団", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 49, 163, 20, "ヒューマン", "傭兵などのアルバイト", 11, 0, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (3, "O", 104901, "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 54, 168, 18, "ヒューマン", "家事全般", 24, 0, 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (14, "A", 105001, "ルーセント学院", "ちょっとおませな恋に恋する女の子", "久野美咲", 22, 120, 11, "魔族", "ファッション誌鑑賞、コスメ集め", 3, 0, 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "A", 105101, "トワイライトキャラバン", "実験が趣味の危険な科学者", "三石琴乃", 53, 166, 27, "ヒューマン", "研究、実験", 7, 0, 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ミツキ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (11, "A", 105201, "牧場（エリザベスパーク）", "乙女チックなもふもふアニマル", "徳井青空", 100, 150, 18, "獣人族", "毛繕い、お喋り", 14, 0, 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "リマ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "A", 105301, "ヴァイスフリューゲル　ランドソル支部", "見た目も中身もお子ちゃまな異国の軍人", "辻あゆみ", 33, 140, 18, "ヒューマン", "お菓子屋通い", 28, 0, 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "モニカ");
