INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("", "O", 105701, "？？？", "空への冒険を夢見る騎空士の少女", "金元寿子", 45, 156, 17, "ヒューマン", "冒険、おしゃべり", 10, 0, 3, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "ジータ");
