INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (1, "A", 107801, "美食殿", "行き倒れの謎のネコミミ魔法使い", "立花理香", 39, 152, 14, "獣人族", "猫と遊ぶ", 2, 0, 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", "キャル（サマー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "AB", 107901, "メルクリウス財団", "弱きを助け強きをくじく猫娘", "沼倉愛美", 48, 158, 18, "獣人族", "猫とたわむれること", 1, 0, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ（サマー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "O", 108001, "メルクリウス財団", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 49, 163, 20, "ヒューマン", "傭兵などのアルバイト", 11, 0, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ（サマー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "AB", 108101, "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", "大坪由佳", 42, 157, 18, "魔族", "占い", 22, 0, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ（ハロウィン）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "B", 108201, "悪魔偽王国軍（ディアボロス）", "プリン大好きゴースト娘", "雨宮天", 32, 130, 14, "魔族", "プリンを食べること", 23, 0, 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ（ハロウィン）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (14, "A", 108301, "ルーセント学院", "ちょっとおませな恋に恋する女の子", "久野美咲", 22, 120, 11, "魔族", "ファッション誌鑑賞、コスメ集め", 3, 0, 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ（ハロウィン）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (4, "O", 108401, "カルミナ", "人々を守るために歌う、唱喚士の少女", "福原綾香", 46, 163, 17, "ヒューマン", "各種楽器", 3, 0, 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（クリスマス）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "B", 108501, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 40, 150, 12, "ヒューマン", "観劇、おままごと", 9, 0, 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ（クリスマス）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "B", 108601, "サレンディア救護院", "ぷうきちといつも一緒！", "芹澤優", 38, 148, 14, "ヒューマン", "屋内でできる遊び", 10, 0, 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ（クリスマス）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "A", 108701, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", "東山奈央", 44, 155, 16, "獣人族", "人助け、応援", 27, 0, 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "O", 108801, "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 47, 158, 17, "ヒューマン", "料理、人間観察", 5, 0, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（ニューイヤー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "B", 108901, "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", "早見沙織", 46, 163, 18, "魔族", "読書、乗馬、お茶", 12, 0, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（ニューイヤー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "B", 109001, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", "橋本ちなみ", 43, 154, 16, "魔族", "実験、裁縫、料理", 30, 0, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（バレンタイン）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (3, "O", 109101, "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 54, 168, 18, "ヒューマン", "家事全般", 24, 0, 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル（バレンタイン）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("", "AB", 109201, "？？？", "英霊と契約を結んだマナリアの天才王女", "日笠陽子", 55, 156, 17, "ヒューマン", "読書", 1, 0, 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "アン");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("", "O", 109301, "？？？", "マナリア魔法学院の新入生", "こやまきみこ", 45, 144, 15, "ヒューマン", "食べること、眠ること", 4, 0, 2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ルゥ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("", "B", 109401, "？？？", "人を超越した力を有す心優しい竜姫", "福原綾香", 67, 167, 17, "半人半竜", "ピアノ", 3, 0, 11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "グレア");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "AB", 109501, "ヴァイスフリューゲル　ランドソル支部", "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", 49, 157, 18, "ヒューマン", "小説を読むこと", 19, 0, 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "クウカ（オーエド）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "O", 109601, "ヴァイスフリューゲル　ランドソル支部", "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 51, 163, 16, "ヒューマン", "忍法開発", 31, 0, 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン（オーエド）");
