INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "AB", 116801, "メルクリウス財団", "弱きを助け強きをくじく猫娘", "沼倉愛美", 48, 158, 18, "獣人族", "猫とたわむれること", 1, 0, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ（作業服）");
