INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "B", 117001, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", "橋本ちなみ", 43, 154, 16, "魔族", "実験、裁縫、料理", 30, 0, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（サマー）");
